import './header.css'
import history from '../history'


export default function Header(props) {
    const logout = () => {
        props.setToken(null)
        history.push('/login')
    }

    return (<div className='Header'>
        <div className='Header-logout-div'>
            <button className='Header-logout' onClick={() => logout()}>Logout</button>
        </div>
    </div>)
}
